function fearNotLetter(str) {
let abc = 'abcdefghijklmnopqrstuvwxyz';
let sliceOfAbc = abc.slice(abc.indexOf(str[0]), abc.indexOf(str.slice(-1)) + 1).split('');

if (str == abc) {return undefined}
let result = sliceOfAbc.filter(
  x => !str.split('').includes(x)
).join();



  return result;
}

